import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
//se importa el componente
import AddVehiculo from "./components/AddVehiculo";
import ModVehiculo from "./components/ModVehiculo";
import ShowVehiculo from "./components/ShowVehiculo";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<AddVehiculo />} />
          <Route path="/add" element={<ModVehiculo />} />
          <Route path="/mod/:id" element={<ShowVehiculo />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
